from unittest import TestCase

from tst._Utils import *


class TestFloatLiteralAst(TestCase):
    @should_pass_compilation
    def test_valid_big_float(self) -> None:
        """
        fun f() -> Void { let x = 0.0 }
        """

    @should_pass_compilation
    def test_valid_f8(self) -> None:
        """
        fun f() -> Void { let x = 0.0_f8 }
        """

    @should_pass_compilation
    def test_valid_f16(self) -> None:
        """
        fun f() -> Void { let x = 0.0_f16 }
        """

    @should_pass_compilation
    def test_valid_f32(self) -> None:
        """
        fun f() -> Void { let x = 0.0_f32 }
        """

    @should_pass_compilation
    def test_valid_f64(self) -> None:
        """
        fun f() -> Void { let x = 0.0_f64 }
        """

    @should_pass_compilation
    def test_valid_f128(self) -> None:
        """
        fun f() -> Void { let x = 0.0_f128 }
        """

    @should_pass_compilation
    def test_valid_f256(self) -> None:
        """
        fun f() -> Void { let x = 0.0_f256 }
        """

    @should_pass_compilation
    def test_valid_f8_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -240.0_f8 }
        """

    @should_pass_compilation
    def test_valid_f16_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -65504.0_f16 }
        """

    @should_pass_compilation
    def test_valid_f32_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -340282346638528859811704183484516925440.0_f32 }
        """

    @should_pass_compilation
    def test_valid_f64_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -.0_f64 }
        """

    @should_pass_compilation
    def test_valid_f128_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -.0_f128 }
        """

    @should_pass_compilation
    def test_valid_f256_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -.0_f256 }
        """

    @should_pass_compilation
    def test_valid_f8_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = 240.0_f8 }
        """

    @should_pass_compilation
    def test_valid_f16_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = 65504.0_f16 }
        """

    @should_pass_compilation
    def test_valid_f32_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = 340282346638528859811704183484516925440.0_f32 }
        """

    @should_pass_compilation
    def test_valid_f64_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = .0_f64 }
        """

    @should_pass_compilation
    def test_valid_f128_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = .0_f128 }
        """

    @should_pass_compilation
    def test_valid_f256_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = .0_f256 }
        """

    @should_fail_compilation
    def test_invalid_f8_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -240.1_f8 }
        """

    @should_fail_compilation
    def test_invalid_f16_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -65504.1_f16 }
        """

    @should_fail_compilation
    def test_invalid_f32_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -340282346638528859811704183484516925440.1_f32 }
        """

    @should_fail_compilation
    def test_invalid_f64_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -.1_f64 }
        """

    @should_fail_compilation
    def test_invalid_f128_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -.1_f128 }
        """

    @should_fail_compilation
    def test_invalid_f256_lower_bound(self) -> None:
        """
        fun f() -> Void { let x = -.1_f256 }
        """

    @should_fail_compilation
    def test_invalid_f8_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = 240.1_f8 }
        """

    @should_fail_compilation
    def test_invalid_f16_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = 65504.1_f16 }
        """

    @should_fail_compilation
    def test_invalid_f32_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = 340282346638528859811704183484516925440.1_f32 }
        """

    @should_fail_compilation
    def test_invalid_f64_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = .1_f64 }
        """

    @should_fail_compilation
    def test_invalid_f128_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = .1_f128 }
        """

    @should_fail_compilation
    def test_invalid_f256_upper_bound(self) -> None:
        """
        fun f() -> Void { let x = .1_f256 }
        """
